let mark = [];
function disp(id){
  if(id != 3){
    for (i = 0; i < (Poly_pos.length);i++){
      if (Poly_pos[ i ] != null){
        Polygons_shape[ i ] = L.polygon([ Poly_pos[ i ] ],
        { color: "#" + edge_col[ i ],
            fillColor: "#" + fill_col[ i ],
            weight: Line_W,
            fillopacity: 0.5
        });
        if(Poly_class[i] === id){
          Polygons_shape[ i ].bindPopup(Poly_nam[ i ] + "<br>" + Polygons_shape_lnk[ i ]);
          Layer_502[ i ] = Polygons_shape[ i ];
          Layer_502[ i ].addTo(map_502);
        }
      }
    }
  }else{
    //避難所
    const redIcon = L.icon({
      iconUrl: "https://esm.sh/leaflet@1.9.2/dist/images/marker-icon.png",
      iconRetinaUrl: "https://esm.sh/leaflet@1.9.2/dist/images/marker-icon-2x.png",
      shadowUrl: "https://esm.sh/leaflet@1.9.2/dist/images/marker-shadow.png",
      iconSize: [25, 41],
      iconAnchor: [12, 41],
      popupAnchor: [1, -34],
      tooltipAnchor: [16, -28],
      shadowSize: [41, 41],
      className: "icon-red", // <= ここでクラス名を指定
    });
    
    for (i = 0; i < (mark_pos.length);i++){
      if (mark_pos[ i ] != null){
        mark.push(L.marker(mark_pos[i], {icon:redIcon}).addTo(map_502));
      }
    }
  }
}
function hidden(id){
  if(id != 3){
    for(i = 0;i < Poly_pos.length;i++){
      if(Poly_class[i] === id){
        map_502.removeLayer(Layer_502[i]);
      }
    }
  }else{
    for(i = mark_pos.length - 1;i >= 0;i--){
        map_502.removeLayer(mark[i]);
        mark.pop();
    }
  }
}
function onClicked(id){
  obj = document.getElementById(id);
  if(obj.checked){
    switch(id){
      case "TAB-02":
        disp(0);
        break;
      case "TAB-01":
        disp(1);
        disp(2);
        break;
      case "TAB-03":
        disp(3);
        break;
    }
  }else{
    switch(id){
      case "TAB-02":
        hidden(0);
        break;
      case "TAB-01":
        hidden(1);
        hidden(2);
        break;
      case "TAB-03":
        hidden(3);
        break;
    }
  }
}

function click_get_position(map){
  // マーカー達の座標
  let polygon=[];
  let polygons=[];
  let positions=[];
  let positionss=[];
  let colors=[];
  // マーカー達の存在
  let markers=[];
  //クリックイベント
  map.on('click', function(e) {
    //クリック位置経緯度取得
    let lat = e.latlng.lat;
    let lng = e.latlng.lng;
    map.removeLayer(polygon);
    positions.push([lat,lng]);
    //markers.push(L.marker([lat,lng]).addTo(map));
    polygon=L.polygon(positions,{color: 'green'}).addTo(map);
  } );
  map.on('dblclick',function(e) {
    console.log(JSON.stringify(positions));
  })
  document.addEventListener('keypress', keypress_ivent);
  function keypress_ivent(e) {
    if(e.key === 'x' && (markers.length > 0 || polygon != null)){
      //map.removeLayer(markers[markers.length - 1]);
      map.removeLayer(polygon);
      markers.pop();
      positions.pop();
      polygon=L.polygon(positions,{color: 'green'}).addTo(map);
    }else if((e.key === 'r' || e.key === 'y') && positions.length > 0){
      console.log(JSON.stringify(positions));
      positionss.push(positions);
      map.removeLayer(polygon);
      if (e.key ==='r'){
        colors.push(2);
        polygons.push(L.polygon(positions,{color: 'purple'}).addTo(map));
      }else{
        colors.push(1);
        polygons.push(L.polygon(positions,{color: 'blue'}).addTo(map));
      }
      polygon=[];
      positions=[];
    }else if(e.key === 'Enter' && positionss.length > 0){
      console.log(" ");
      let s="";
      for(let i=0;i<positionss.length;i++){
        s+="Poly_pos[ ;"+"; + "+String(i+1)+ " ] = "+JSON.stringify(positionss[i])+";"
        s+="Poly_class[ ;"+"; + "+String(i+1)+ " ] = "+ colors[i] +";"
      }
      console.log(s)
    }else if(e.key === 'q' && colors.length > 0 && positions.length == 0){
      map.removeLayer(polygons[polygons.length-1]);
      positionss.pop();
      polygons.pop();
      colors.pop();
    }
    return false; 
  }
  document.addEventListener('DOMContentLoaded', img(map));
}
